import React from 'react';
import 'antd/dist/antd.css';
import './custom.css'


export default class Homepage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      user: '',
      pass: ''
    };

    this.props.history.push('/login');
  }
 
  render() {
    return (
      <div>
          <p>
              TUMMMMMMMMMMMMMMMMMMMMMMMMM
          </p>
      </div>
    );
  }
}
